import React from "react";

const Card = () => {
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
      <img src="https://robohash.org/test" alt="kaushik" />
      <div>
        <h2>Kaushik Koparkar</h2>
        <p>koparkar.kaushik@gmail.com</p>
      </div>
    </div>
  );
};

export default Card;
